import { Component } from '@angular/core';
import { HttpClient ,HttpHeaders} from '@angular/common/http';
@Component({
  selector: 'app-delete-project',
  templateUrl: './delete-project.component.html',
  styleUrls: ['./delete-project.component.css']
})
export class DeleteProjectComponent {
username: any;
  //http://localhost:8083/api/project/all/projects

  projects: any[] = []; // Populate this array with your project data
  updateClicked = false;
  selectedProject: any;
  selectedTaskStatus: string;

  constructor(private http : HttpClient) {}
  ngOnInit(): void {


   this.GetProjects();
  }
  selectProject(project: any) {
    this.selectedProject = project;
  }

  GetProjects(){
    const token = JSON.parse(sessionStorage.getItem('key')).token;

    const headers = new HttpHeaders({
      'Authorization': `Bearer ${token}`
    });
    this.http.get<any[]>('http://localhost:8083/api/project/all/projects',{headers}).subscribe((response)=>{
      console.log(response);
      this.projects = response;
      sessionStorage.setItem('allProjectkey',JSON.stringify(response));

    })
  }

}
<div class="container-fluid page">
    <div class="d-flex page__box p-3 mt-2">Projects</div>
    <div class="page__content shadow p-3 position-relative">
      <div class="page__content-data">
  <div class="project-list">
     <h1>{{projects}}</h1>
      <ul>
        <li *ngFor="let project of projects" (click)="selectProject(project)">
          {{ project.name }}
        </li>
      </ul>
    </div>

    <div class="project-details" *ngIf="selectedProject">
      <h2>Project Details</h2>
      <table>
        <tr>
          <th>Project ID</th>
          <th>Name</th>
          <th>Description</th>
          <th>Status</th>
          <th>Assigned By</th>
        </tr>
        <tr>
          <td>{{ selectedProject.project_id }}</td>
          <td>{{ selectedProject.name }}</td>
          <td>{{ selectedProject.description }}</td>
          <td>{{ selectedProject.status }}</td>
          <td>{{selectedProject.assignedBy}}</td>
        </tr>
      </table>

      <h2>Tasks</h2>
      <table>
        <tr>
          <th>Task ID</th>
          <th>Name</th>
          <th>Status</th>
          <th>Assigned To</th>
          <th>AssignedDate</th>
          <th>Completion Date</th>
        </tr>
        <tr *ngFor="let task of selectedProject.tasks">
          <td>{{ task.task_id }}</td>
          <td>{{ task.name }}</td>
          <td>{{task.status}}</td>
          <td>{{task.assignedTo}}</td>
          <td>{{task.assignedDate}}</td>
          <td>{{task.completionDate}}</td>
        </tr>
      </table>
    </div>
      </div>
    </div>
  </div>
